import React from 'react';
// import ReactDOM from 'react-dom/client';
import { Link } from 'react-router-dom';
import { useState } from 'react';
import './home.css';

// const apiURL = '';
const mockTransaction = [
    { date: '20/02/2024', time: '10:53:00', type: 'Deposit-ATM', amout: 200.00, total: 1000.00 },
    { date: '20/02/2024', time: '10:53:00', type: 'Withdraw-ATM', amout: 200.00, total: 1000.00 }
]

function Home() {

    const [transaction, setTransaction] = useState(mockTransaction);
    console.log(transaction)
    // useEffect(() => {
    //     fetch(apiURL)
    //         .then((res) => {
    //             return res.json();
    //         })
    //         .then((data) => {
    //             console.log(data);
    //             setTransaction(data);
    //         });
    // }, []);

    return (
        <>
        <div className='bg'></div>
        <div className='container'>
            <div className='content'>
                <div className='row balance'>
                    <h1>balance</h1>
                    <div className='blance'>
                        $ 50.00
                    </div>

                </div>
                <div className='row'>
                    <div className='link-btn'>
                        <Link to='/deposit'><i class="fa-solid fa-money-bill-transfer"></i> Deposit</Link>
                        <Link to='/transfer'><i class="fa-solid fa-arrow-right-arrow-left"></i> Transfer</Link>
                        <Link to='/withdraw'><i class="fa-solid fa-money-bill-transfer"></i> Withdraw</Link>
                    </div>
                </div>
                <div className='row'>
                    {/* Display transactions here */}
                    <ul>
                        {transaction.map((transaction, index) => (
                            <li key={index}>
                                {transaction.date} - {transaction.type} - ${transaction.amount}
                            </li>
                        ))}
                    </ul>
                </div>
            </div>
        </div>
        </>
    )
}


export default Home;
